// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import {Ownable} from "../../../abstract/Ownable.sol";
import {ListEmployeeCursor} from "../../../cursor/ListEmployeeCursor.sol";
import {ListCVCursor} from "../../../cursor/employee/cv/ListCVCursor.sol";
import {CV} from "../../../struct/employee/cv/CVStruct.sol";
import {DATABASE_KEY} from "../../../constant/SecretKey.sol";

uint256 constant IIGCATEGORY = 2;

contract IIGController is Ownable, ListEmployeeCursor, ListCVCursor {
    constructor(address listEmployeeAddress, address listCVAddress)
        Ownable()
        ListEmployeeCursor(listEmployeeAddress)
        ListCVCursor(listCVAddress)
    {}

    function addCV(uint256 employeeId, string memory data)
        public
        onlyEmployeeIdBelongstoAddress(employeeId)
        returns (bool)
    {
        CV memory item = CV(employeeId, 0, data);
        return _getListCVCursor().add(item, DATABASE_KEY);
    }

    function getListCVByEmployeeId(uint256 employeeId)
        public
        view
        returns (CV[] memory)
    {
        uint256 length = 0;
        for (
            uint256 i = 1;
            i <= _getListCVCursor().getLength(DATABASE_KEY);
            i++
        ) {
            if (_getListCVCursor().at(i, DATABASE_KEY).employeeId == employeeId)
                length++;
        }

        CV[] memory list = new CV[](length);
        uint256 j = 0;
        for (
            uint256 i = 1;
            i <= _getListCVCursor().getLength(DATABASE_KEY);
            i++
        ) {
            CV memory item = _getListCVCursor().at(i, DATABASE_KEY);
            if (item.employeeId == employeeId) {
                list[j] = item;
                j++;
            }
        }
        return list;
    }
}

