// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {DATABASE_KEY} from "../../../constant/SecretKey.sol";
import {ListCV} from "../../../database/employee/cv/ListCV.sol";

abstract contract ListCVCursor {
    ListCV private listCVCursor;
    address private listCVAddress;

    constructor(address value) {
        listCVAddress = value;
        listCVCursor = ListCV(value);
    }

    modifier onlyCVIdBelongstoId(uint256 id, uint256 cvId) {
        require(
            _checkCVIdBelongstoId(id, cvId),
            "ListCVCursor: id is not belongs to address"
        );
        _;
    }

    function _checkCVIdBelongstoId(uint256 id, uint256 cvId)
        internal
        view
        returns (bool)
    {
        uint256 validateEmployeeId = listCVCursor
            .at(cvId, DATABASE_KEY)
            .employeeId;
        if (validateEmployeeId == id) return true;
        return false;
    }

    function _getListCVCursor() internal view returns (ListCV) {
        return listCVCursor;
    }
}

