// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {Ownable} from "../../../abstract/Ownable.sol";

import {DATABASE_KEY} from "../../../constant/SecretKey.sol";

import {CV} from "../../../struct/employee/cv/CVStruct.sol";
import {StringTool} from "../../../library/StringTool.sol";

contract ListCV is Ownable {
    mapping(uint256 => CV) private list;
    uint256 private autoIncrement = 0;

    using StringTool for string;

    constructor() Ownable() {}

    event Add(CV item);

    event Remove(CV item);

    modifier requestSecretkey(bytes32 value) {
        require(value == DATABASE_KEY, "Database ListCV: Secret key error");
        _;
    }

    modifier validIndex(uint256 index) {
        require(
            (1 <= index) && (index <= autoIncrement),
            "Database ListCV: Invalid index"
        );
        _;
    }

    function getLength(bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        return autoIncrement;
    }

    function add(CV memory item, bytes32 secret)
        public
        requestSecretkey(secret)
        returns (bool)
    {
        autoIncrement++;
        item.cvId = autoIncrement;
        list[autoIncrement] = item;
        emit Add(item);
        return true;
    }

    function edit(
        uint256 cvId,
        CV memory item,
        bytes32 secret
    ) public requestSecretkey(secret) returns (bool) {
        autoIncrement++;
        list[cvId] = item;
        return true;
    }

    function at(uint256 index, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        validIndex(index)
        returns (CV memory)
    {
        return list[index];
    }
}

